import '../style.css';
import SignUp from './signUp';

const Top = () => {
  return (
    <>
      <Link to='/signup'>
        <button className='sign-up-button'>新規登録</button>
      </Link>
      <button>ログイン</button>
    </>
  );
};

export default Top;
